From FootPowder.scad:  
// pry the top off of you foot powder bottle (you'll probably have to use a screw driver to get under it and pop it off) and measure 4 things:<br />
// 1: the diameter of the bottle below the bulge that holds the cap on<br />
lowerBottleDiameter = 28.8;<br />
// 2: the diameter of that bulge that keeps the cap on<br />
bulgeDiameter = 31;<br />
// 3: the distance from the lower corner that bulge makes with the lower bottle up to the top of the bottle<br />
belowBulgeToTop = 7.94;<br />
// 4: the diameter of the top of the bottle<br />
topBottleDiameter = 27.6;<br />
// of course you might have to massage the numbers a little bit if it doesn't fit. The above numbers gave me a fit that's a little loose, but goes on without too much trouble, and hasn't yet leaked too much powder.
